import { useDispatch } from 'react-redux';

import './Button.scss';

export const CtButton = ({ data, onClick }) => {
    const dispatch = useDispatch();
    const handeClick = () => {
        onClick()
    }

    return (
        <div className={`${data.btnType} ct__button outline prefixIcon cursor-pointer`} onClick={handeClick}>
            <div className="row">
                {data.prefixIcon}
                {data.description}
            </div>
            <div className="row">
                {data.suffixIcon}
            </div>
        </div>
    );
}
